import { createSlice } from "@reduxjs/toolkit";

export const autoSlice = createSlice({
  name: "auto",
  initialState: {
    autok: [],
  },
  reducers: {
    feltolt: (state, action) => {
      state.autok = action.payload.autok;
    },
  },
});

export const { feltolt } = autoSlice.actions;
export default autoSlice.reducer;
